INSERT INTO `tblSystemSettings` VALUES(3, 'CREDIT APPROVAL NOTIFICATION', 'CANM', 'This is the message that customer will received via email and text if he/she\'s Credit is approve.', NULL, 'NOTIFICATION', 'YES', '<p>Welcome to MLOC! Your account has been activated and was approved for {amount} USD credit line.</p>\r\n', '<p>Hello, {firstname}<br />\r\n<br />\r\nWelcome to MLOC! Your account has been activated and was approved for ${amount} credit line.<br />\r\n<br />\r\nRegards,<br />\r\nMLOC Team</p>\r\n', 'New MLOC Registration', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `tblSystemSettings` VALUES(4, 'CREDIT PENDING NOTIFICATION', 'CPNM', 'This is the message that customer will received via email and text if he/she\'s Credit is pending.', NULL, 'NOTIFICATION', 'YES', 'Welcome to MLOC! Your application for {amount} USD credit line is being reviewed. ', 'Hello, {firstname} <br><br>Welcome to MLOC! Your application for ${amount} credit line is being reviewed. <br><br>Regards, <br>MLOC Team<br>', 'MLOC Pending', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `tblSystemSettings` VALUES(5, 'CREDIT REJECTED NOTIFICATION', 'CRNM', 'This is the message that customer will received via email and text if he/she\'s Credit is rejected.', NULL, 'NOTIFICATION', 'YES', '<p>sorry you rejected</p>\r\n', '<p>rejected&nbsp;</p>\r\n\r\n<hr />\r\n<p>123</p>\r\n\r\n<hr />\r\n<p>&nbsp;</p>\r\n', '', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `tblSystemSettings` VALUES(6, 'LOAN APPROVAL NOTIFICATION', 'LANM', 'This is the message that customer will received via email and text if he/she\'s Loan is approved.', NULL, 'NOTIFICATION', 'YES', 'Your loan request of {amount} USD has been approved and  credited to your mobile wallet. Thank you for your business.', 'Hello, {firstname} <br><br>Your loan request of ${amount} has been approved and  credited to your mobile wallet. Thank you for your business. <br><br>Regards, <br>MLOC Team<br>', 'Loan Approved', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `tblSystemSettings` VALUES(7, 'LOAN PENDING NOTIFICATION', 'LPNM', 'This is the message that customer will received via email and text if he/she\'s Loan is pending.', NULL, 'NOTIFICATION', 'YES', 'Your loan request of {amount} USD is being reviewed.', 'Hello, {firstname} <br><br>Your loan request of ${amount} is being reviewed. <br><br>Regards, <br>MLOC Team<br>', 'Loan Pending', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `tblSystemSettings` VALUES(8, 'LOAN REJECTED NOTIFICATION', 'LRENM', 'This is the message that customer will received via email and text if he/she\'s Loan is rejected.', NULL, 'NOTIFICATION', 'YES', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
